(()=>{"use strict";[{id:1,text:"Faire les courses",done:!1},{id:2,text:"Aller chercher les enfants",done:!0}].forEach((e=>(e=>{document.querySelector("ul").insertAdjacentHTML("beforeend",`\n        <li>\n            <label>\n                <input type="checkbox" id="${e.id}" ${e.done?"checked":""} /> \n                ${e.text}\n            </label>\n        </li>\n    `)})(e)))})();